oxy_webhelp_navlinks = {"gcp_storage_tiering_setup-d22872e14558":{"topics":[{"title":"Evaluation of options for GCP storage tiering","shortdesc":"<p class=\"shortdesc\">Before setting up GCP storage tiering, it is important to evaluate the tiering         options to align with archiving needs, balancing cost, performance, and data retrieval. Key         considerations include the regions where you want to store the archived snapshots, GCP         storage classes, instant tiering, and custom storage encryption.<\/p>","href":"gcp\/evaluate_options_gcp_storage_tiering.html","attributes":{"data-id":"evaluate_options_gcp_storage_tiering"},"menu":{"hasChildren":false},"tocID":"evaluate_options_gcp_storage_tiering-d22872e14569","next":"evaluate_options_gcp_storage_tiering-d22872e14569"},{"title":"Configuration of GCP storage tiering","shortdesc":"<p class=\"shortdesc\">To configure GCP storage tiering, you must create an archival location for archiving         snapshots and storing backups.<\/p>","href":"gcp\/config_gcp_storage_tiering.html","attributes":{"data-id":"config_gcp_storage_tiering"},"menu":{"hasChildren":false},"tocID":"config_gcp_storage_tiering-d22872e14621","next":"config_gcp_storage_tiering-d22872e14621"}]}};